text:
if i did it for likes... i would post this in the morning and hashtag the crap out of it, but this song means too much to me not to go ‘head tell ‘em!

@nathancito officially called me gotti first? ✊🏽 stuck ever since then and now i murder things differently.  the ‘e’ on the end is for everything extra!! baptized my mom last year on 1/6 (swipe 👈🏽) and the point of baptism isn’t salvation, but to proclaim what you believe. so you should “go ‘head... tell ‘em!” can’t believe i had the opportunity to help you tell ‘em all, ma 🙌🏽 i love you ❤️ was trynna not post anything in 2019 waiting on some major moves, but when i lost like 20 pairs of j’s in a storage fire years back i learned to do it all... wear it all... now!  don’t wait!! now onto learning how to mix better and master songs for the master 🙏🏽🙌🏽 #linkinbio #gottie #hisent #good #hood #music #4jesus #tgbtg #mood #2019 #rap #hippityhop #la #cali #harlem #happymonday #listen #christiansrus 
as always s/o to @forgetlife428 for some 🔥 i could spit to... and @jay_telis i’m back on yours for that album this quarter ✊🏽 gotta get better to do those beats justice 🙌🏽 don’t you hate when people type this much on a picture app? 🤦🏽‍♂️ #metoo

